import "./product.css";
import guess from "../../images/guess.jpeg";
import fetch from "../../images/fetch.jpeg";
import bankist from "../../images/bankist.jpeg";
import monsters from "../../images/monsters.jpg";

const Product = () => {
  return (
    <div className="p">
      <div className="p-browser">
        {/* <div className="p-circle"></div>
        <div className="p-circle"></div>
        <div className="p-circle"></div> */}
      </div>
      <div className="pc">
        <h4 className="h4">JS Game</h4>
        <a href='https://mayenge.github.io/guess/' target="_blank" rel="noreferrer">
          <img src={guess} alt="" className="p-img" />
        </a>
      </div>
          
      
      <div className="p-browser2">
        {/* <div className="p-circle"></div>
        <div className="p-circle"></div>
        <div className="p-circle"></div> */}
      </div>
      <div className="pc">
      <h4 className="h4">Banking App</h4>
      <a href='https://mayenge.github.io/mike-simba.github.io/' target="_blank" rel="noreferrer">
        <img src={bankist} alt="" className="p-img" />
      </a>
     </div>
      {/* <div className="p-browser">
        {/* <div className="p-circle"></div>
        <div className="p-circle"></div>
        <div className="p-circle"></div> */} 
      
      <div className="pc">
          <h4 className="h4">JS fetch App</h4>
      <a href='https://mayenge.github.io/simbafetch' target="_blank" rel="noreferrer">
        <img src={monsters} alt="" className="p-img" />
      </a>
      </div>
      <div className="pc">
      <h4 className="h4">React Monsters</h4>
      <a href='https://mayenge.github.io/monsters-rolodex/' target="_blank" rel="noreferrer">
        <img src={fetch} alt="" className="p-img" />
      </a>
      </div>
      
    </div>
    
  );
};

export default Product;
